function ClosingCross(props) {
  return (
    <div>
      <a class="close" />
      <style jsx>{`
        .close {
          opacity: 0.5;
        }
        .close:hover {
          opacity: 1;
        }
        .close:before,
        .close:after {
          position: absolute;
          left: 15px;
          content: " ";
          height: 33px;
          width: 2px;
          background-color: #333;
        }
        .close:before {
          transform: rotate(45deg);
        }
        .close:after {
          transform: rotate(-45deg);
        }
      `}</style>
    </div>
  );
}

export default ClosingCross;
